import React, { Component } from 'react'
import {Container,Heading} from './style';

export default class AccountOverview extends Component {

    render() {
        return (
            <div>
                <Container>
                    <Heading>Account Overview</Heading>
                    
                </Container>
                
            </div>
        )
    }
}
